import { error } from 'jquery'
import React from 'react'

function ErrorDisplayComponent(props) {
    const {overs}=props.overs

    if(overs==="50"){
        throw new Error('Not a T20I match');
    }
    
    return (
        <div>
            {props.overs}
        </div>
    )
}

export default ErrorDisplayComponent
